// router.js
import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Blog from "./components/page/blog";

const Routess = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Blog />} />
      </Routes>
    </BrowserRouter>
  );
};

export default Routess;
